import nltk
import re

def cleanr(raw_html):
     cleanr = re.compile('''(<.*?>)|(https?:\/\/[^\s]+)|
     ([\]\[\\/?!@#$%^&*><~`.:\s{}(),;"])|
     (\d)|(\b[A-Z]+\b)|
     (\B-)|
     ((?<= )\b\w{1,2}\b)''')
     cleantext = re.sub(cleanr, ' ', raw_html)
     return cleantext
     
def clean(raw):
    cleaner = ['(<.*?>)','(https?:\/\/[^\s]+)','([\]\[\\/?!@#$%^&*><~`.:\s{}(),;"])','(\d)','(\b[A-Z]+\b)','(\B-)']
    text = raw
    for i in cleaner:
     pattern = re.compile(i)
     cleantext = re.sub(pattern, ' ', text)
     text = cleantext
     print('\n',text[:400])
    return text
     
